  return (
    <div>
      <header>
        <div style={{ padding: "12px" }}>
          <h1>Hottest</h1>
        </div>

        <p>The most dicussed articles on NC-News.</p>
      </header>
      <ArticleList urlPath="?sort_by=comment_count" />
    </div>
  );
};

export default Hottest;
